import React from "react";
import "../../css/HomePage.css";
import apple from "../../images/apple.png";
import banana from "../../images/banana.png";
import orange from "../../images/orange.png";
import strawberry from "../../images/strawberry.png";

const Home = () => {
  return (
    <div className="home-container">
      <div className="content-wrapper">
        <div className="left-content">
          <h1 className="welcome-text">
            <span className="welcome-to">Welcome to</span>
            <br />
            <span className="fitness-tracker">Fitness-Tracker</span>
          </h1>
          <button className="get-started-button">Get Started</button>
        </div>
      </div>
      <div className="green-circle"></div>
      <img src={apple} alt="Apple" className="fruit fruit-1" />
      <img src={banana} alt="Banana" className="fruit fruit-2" />
      <img src={orange} alt="Orange" className="fruit fruit-3" />
      <img src={strawberry} alt="Strawberry" className="fruit fruit-4" />
    </div>
  );
};

export default Home;
